import React from 'react'
import TabViews from '../components/TabViews/index'

export default {
  title: 'Tab Views',
  component: TabViews
}

export function TabViewsContainer() {

  const props = {
    currentTabValue: 0,
    tabChange: () => {},
    data: {},
    tabValues: [
      intl.formatMessage(globalMessages.overview),
      intl.formatMessage(globalMessages.reports),
      intl.formatMessage(globalMessages.submissions),
      intl.formatMessage(globalMessages.translations),
      intl.formatMessage(globalMessages.preview)
    ],
    indexChange: () => {},
    tabViews: [<>Test Tab</>],
  };

  return (
    <div> 
      <TabViews {...props}/>
    </div>
  )
}
